description:
World War Hulk - Gamma Corps 01-04 (2007-2008|Digital|Minutemen-Faessla)

Promotional info for the collected edition - &quot;The Hulk. The Abomination. The Leader. The Harpy. Doc Samson. Born of gamma radiation, they represented a new chapter of humanity. Now, spawned through their respective DNA has come the next generation... the Gamma Corps. Recruited and trained by the enigmatic General Ryker, their mission is a simple one - to kill the Incredible Hulk. And considering he's facing 5-1 odds, is that a mission even this new and improved version of the Green Goliath can prevent? &quot;

Thanks to Minutemen-Faessia for the digital copy. Please seed and enjoy. 

